import React, { useState } from 'react';
import '../assets/Jadwal.css';

const Jadwal = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filterStatus, setFilterStatus] = useState('');

  // Contoh data jadwal
  const [schedules] = useState([
    {
      id: 'J001',
      kegiatan: 'Rapat Koordinasi Tim Medis',
      tanggal: '2025-10-27',
      waktu: '09:00',
      lokasi: 'Ruang Rapat Utama',
      status: 'Belum Dilaksanakan'
    },
    {
      id: 'J002',
      kegiatan: 'Pemeriksaan Kesehatan Rutin',
      tanggal: '2025-10-27',
      waktu: '13:00',
      lokasi: 'Poli Umum',
      status: 'Sedang Berlangsung'
    },
    {
      id: 'J003',
      kegiatan: 'Pelatihan Penanganan Darurat',
      tanggal: '2025-10-28',
      waktu: '08:30',
      lokasi: 'Aula Lantai 2',
      status: 'Selesai'
    },
    {
      id: 'J004',
      kegiatan: 'Evaluasi Pasien Harian',
      tanggal: '2025-10-29',
      waktu: '10:00',
      lokasi: 'Ruang ICU',
      status: 'Belum Dilaksanakan'
    }
  ]);

  // Filter berdasarkan pencarian dan status
  const filteredSchedules = schedules.filter((schedule) => {
    const matchSearch = schedule.kegiatan.toLowerCase().includes(searchTerm.toLowerCase()) ||
                        schedule.lokasi.toLowerCase().includes(searchTerm.toLowerCase());
    const matchStatus = filterStatus === '' || schedule.status === filterStatus;
    return matchSearch && matchStatus;
  });

  const getStatusClass = (status) => {
    switch (status) {
      case 'Belum Dilaksanakan':
        return 'pending';
      case 'Sedang Berlangsung':
        return 'ongoing';
      case 'Selesai':
        return 'done';
      default:
        return '';
    }
  };

  const handleAddSchedule = () => {
    console.log('Tambah jadwal baru');
  };

  const handleViewSchedule = (schedule) => {
    console.log('Lihat detail jadwal:', schedule);
  };

  const handleEditSchedule = (schedule) => {
    console.log('Edit jadwal:', schedule);
  };

  const handleDeleteSchedule = (schedule) => {
    console.log('Hapus jadwal:', schedule);
  };

  return (
    <div className="dashboard-content">
      <div className="page-header">
        <div className="header-content">
          <h1>Daftar Jadwal</h1>
          <p className="header-subtitle">Kelola dan pantau seluruh jadwal kegiatan</p>
        </div>
        <div className="header-actions">
          <button className="btn-primary" onClick={handleAddSchedule}>
            <svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
              <path d="M19 13H13v6h-2v-6H5v-2h6V5h2v6h6v2z" />
            </svg>
            Tambah Jadwal
          </button>
        </div>
      </div>

      <div className="schedules-section">
        <div className="section-header">
          <h3 className="section-title">Jadwal Kegiatan</h3>
          <div className="search-filter">
            <div className="search-box">
              <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                <circle cx="11" cy="11" r="8" />
                <path d="m21 21-4.35-4.35" />
              </svg>
              <input
                type="text"
                placeholder="Cari jadwal..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
            </div>
            <select
              className="filter-select"
              value={filterStatus}
              onChange={(e) => setFilterStatus(e.target.value)}
            >
              <option value="">Semua Status</option>
              <option value="Belum Dilaksanakan">Belum Dilaksanakan</option>
              <option value="Sedang Berlangsung">Sedang Berlangsung</option>
              <option value="Selesai">Selesai</option>
            </select>
          </div>
        </div>

        <div className="schedules-table">
          <div className="table-header">
            <div className="th">ID</div>
            <div className="th">Kegiatan</div>
            <div className="th">Tanggal</div>
            <div className="th">Waktu</div>
            <div className="th">Lokasi</div>
            <div className="th">Status</div>
            <div className="th">Aksi</div>
          </div>

          <div className="table-body">
            {filteredSchedules.length === 0 ? (
              <div className="table-row">
                <div className="td" style={{ gridColumn: '1 / -1', textAlign: 'center', padding: '2rem' }}>
                  <p>Tidak ada jadwal ditemukan</p>
                </div>
              </div>
            ) : (
              filteredSchedules.map((schedule) => (
                <div key={schedule.id} className="table-row">
                  <div className="td">{schedule.id}</div>
                  <div className="td">{schedule.kegiatan}</div>
                  <div className="td">{schedule.tanggal}</div>
                  <div className="td">{schedule.waktu}</div>
                  <div className="td">{schedule.lokasi}</div>
                  <div className="td">
                    <span className={`status-badge ${getStatusClass(schedule.status)}`}>
                      {schedule.status}
                    </span>
                  </div>
                  <div className="td">
                    <div className="action-buttons">
                      <button className="btn-action view" title="Lihat" onClick={() => handleViewSchedule(schedule)}>
                        <svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
                          <path d="M12 4.5C7 4.5 2.73 7.61 1 12c1.73 4.39 6 7.5 11 7.5s9.27-3.11 11-7.5c-1.73-4.39-6-7.5-11-7.5z" />
                          <circle cx="12" cy="12" r="3" />
                        </svg>
                      </button>
                      <button className="btn-action edit" title="Edit" onClick={() => handleEditSchedule(schedule)}>
                        <svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
                          <path d="M3 17.25V21h3.75L17.81 9.94l-3.75-3.75L3 17.25z" />
                        </svg>
                      </button>
                      <button className="btn-action delete" title="Hapus" onClick={() => handleDeleteSchedule(schedule)}>
                        <svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
                          <path d="M16 9v10H8V9h8m-1.5-6h-5l-1 1H5v2h14V4h-4.5l-1-1z" />
                        </svg>
                      </button>
                    </div>
                  </div>
                </div>
              ))
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Jadwal;
